template <typename T>
vector<size_t> sort_indexes(const vector<T> &v) {

	// initialize original index locations
	vector<size_t> idx(v.size());
	iota(idx.begin(), idx.end(), 0);

	// sort indexes based on comparing values in v
	sort(idx.begin(), idx.end(),
		[&v](size_t i1, size_t i2) {return v[i1] < v[i2]; });

	return idx;
}

template <typename T>
vector<T> getSigma(const vector<T>& v1, const vector<T>& v2)
{
	vector<T> v2_orderedUsingV1_sort = v2;
	int tmp = 0;
	for (auto i : sort_indexes(v1))
	{
		v2_orderedUsingV1_sort[tmp] = v2[i];
		tmp++;
	}

	vector<T> sigma = v2_orderedUsingV1_sort;
	tmp = 0;
	for (auto i : sort_indexes(v2_orderedUsingV1_sort))
	{
		sigma[tmp] = i;
		tmp++;
	}

	//cout << "sigma:" << endl;
	//for (int i = 0; i < sigma.size(); i++)
	//{
	//	cout << i << ", " << sigma[i] << ": " << v2_orderedUsingV1_sort[sigma[i]] << endl;
	//}

	return sigma;
}


template<typename T>
class Result {
public:
	vector<T> subSet;
	vector<int> indicesVec;
	int startIndex;
	int endIndex;
};

template<typename T> //Assuming operators >=, <= exist for T.
Result<T> getSubSetInRange(const vector<T> set, T lowVal, T highVal)
{
	int finalSubSetSize = 0;
	int initialSubSetSize = set.size();

	vector<T> subSet(initialSubSetSize); //RunTime allocation

	vector<int> indicesVec(initialSubSetSize);

	for (int i = 0; i<set.size(); i++)
	{
		if (set[i] >= lowVal && set[i] < highVal)
		{
			subSet[finalSubSetSize] = set[i];
			indicesVec[finalSubSetSize] = i;
			finalSubSetSize++;
		}
	}

	subSet.resize(finalSubSetSize);
	indicesVec.resize(finalSubSetSize);

	Result<T> res;
	res.subSet = subSet;
	res.indicesVec = indicesVec;
	res.startIndex = indicesVec[0];
	res.endIndex = indicesVec[indicesVec.size() - 1];

	return res;
}

