vector<float> findRoots(float a, float b, float c)
{
	vector<float> roots;

	if (a == 0)
	{
		//Do nothing - This case is a linear function not quadratic.
	}
	else
	{
		float q = b * b - 4 * a*c;
		if (q > 0)
		{ // 2 different real roots
			roots.push_back((-b + sqrt(q)) / (2 * a));
			roots.push_back((-b - sqrt(q)) / (2 * a));
		}
		else if (q == 0) // two equal roots (one root)
		{
			roots.push_back((-b) / (2 * a));
		}
		else // (q<0 - two complex roots, not applicable)
		{
			// Do nothing
		}
	}

	return roots;

}

float EstimateInlierRate(float KN, float N)
{
	float estimatedInlierRate = 0;

	float KI = 0;
	float KO = (float(1) / 2);
	float KIO = (float(1) / 3);

	// ax^2 + bx + c = 0
	float a = KI + KO - 2 * KIO;
	float b = -KI - KO * (2 * N - 1) + 2 * N*KIO;
	float c = N * (N - 1)*(KO - KN);

	vector<float> roots = findRoots(a, b, c);

	roots.push_back(0);
	estimatedInlierRate = (*max_element(roots.begin(), roots.end())) / N;

	return estimatedInlierRate;
}

OverlapResult FindOverlapFullSearch(vector<int> sigma)
{
	int startIndex = -1; // second image appropriate starting index of best overlap result
	int endIndex = -1; // second image appropriate ending index of best overlap result
	int startIndexAccordingToMatlab = -1; // second image appropriate starting index of best overlap result
	int endIndexAccordingToMatlab = -1; // second image appropriate ending index of best overlap result
	int startOrigIndex = -1; // original image appropriate starting index 
	int endOrigIndex = -1; // original image appropriate ending index 
	float curNg = 0;
	float maxNg = 0; // T.B.D (maybe int instead)
	OverlapResult overlapResOutput;

	const int res = 10;
	int resolutionVec[res + 1];
	float interval = ((float)sigma.size()) / res;
	resolutionVec[0] = 0;
	for (int i = 0; i<res; i++) {
		resolutionVec[i] = i * interval;
	}

	resolutionVec[res] = sigma.size() - 1;

	for (int i1 = 0; i1 < res; i1++)
	{
		int origIndex1 = resolutionVec[i1];

		for (int i2 = i1 + 1; i2 < (res + 1); i2++)
		{ // Per-Window in original sequence [0,N-1]
			int origIndex2 = resolutionVec[i2];

			/* Notice that for i2=res this is the last index+1 for special case scenario of last index */
			if (i2 == res) { origIndex2++; } // manipulation trick for getSubSetInRange to unboundrd
			Result<int> sigmaInRange = getSubSetInRange(sigma, origIndex1, origIndex2); // range is [origIndex1, origIndex2)

																						// Per-Window: search over all sub-windows in [origIndex1, origIndex2) sequence for which sigma is appliad
			for (int j1 = 0; j1 < (i2 - i1); j1++)
			{
				for (int j2 = j1 + 1; j2 < (i2 - i1 + 1); j2++)
				{
					//subWindowIndex1 - start of sub-window
					//subWindowIndex2 - end of sub-window
					//sigmaInRangeSubSet[subWindowIndex1: subWindowIndex2]
					int subWindowIndex1 = resolutionVec[i1 + j1] - resolutionVec[i1];
					int subWindowIndex2 = resolutionVec[i1 + j2] - resolutionVec[i1];
					if ((i1 + j2) == res) {
						subWindowIndex2++;
					}
					vector<int> sigmaInRangeSubSet(sigmaInRange.subSet.begin() + subWindowIndex1, sigmaInRange.subSet.begin() + subWindowIndex2);
					vector<int> sigmaInRangeSubSetIndices(sigmaInRange.indicesVec.begin() + subWindowIndex1, sigmaInRange.indicesVec.begin() + subWindowIndex2);

					int* a = &sigmaInRangeSubSet[0];

					int sigmaInRangeSubSetSize = sigmaInRangeSubSet.size();

					// calculating Kendall Distance (counting inversion)
					int sigmaInversionCount = mergeSort(a, sigmaInRangeSubSet.size()); // counting inversions = Kendall Distance
																					   // estimate inlier rate according to PAMI article

					float sigmaInversionCountNorm = 0;
					float estimatedInlierRate = 0;
					if (sigmaInRangeSubSetSize > 1) { // Avoid divide in 0
						sigmaInversionCountNorm = (float)sigmaInversionCount / (float)(sigmaInRangeSubSetSize*(sigmaInRangeSubSetSize - 1) / 2);
						estimatedInlierRate = EstimateInlierRate(sigmaInversionCountNorm, sigmaInRangeSubSetSize);
						curNg = estimatedInlierRate * (float)(sigmaInRangeSubSetSize);
					}
					else { // For avoiding divide in 0 - this case can't be optimal so curNg = 0
						curNg = 0;
					}

					if (curNg > maxNg) { // maximal overlap
						maxNg = curNg;
						startIndex = sigmaInRangeSubSetIndices[0]; //sigmaInRange.startIndex;
						endIndex = sigmaInRangeSubSetIndices[sigmaInRangeSubSetIndices.size() - 1]; //sigmaInRange.endIndex;

						startIndexAccordingToMatlab = resolutionVec[j1];
						endIndexAccordingToMatlab = resolutionVec[j2];


						startOrigIndex = origIndex1;
						endOrigIndex = origIndex2;
					}
				}
			}

		}
	}

	overlapResOutput.maxNg = maxNg;
	overlapResOutput.startIndex = startIndex;
	overlapResOutput.endIndex = endIndex;
	overlapResOutput.startIndexAccordingToMatlab = startIndexAccordingToMatlab;
	overlapResOutput.endIndexAccordingToMatlab = endIndexAccordingToMatlab;
	overlapResOutput.startOrigIndex = startOrigIndex;
	overlapResOutput.endOrigIndex = endOrigIndex;

	return overlapResOutput;

}


OverlapResult PAMI(vector<int> X_features1, vector<int> X_features2) {
	vector<int> sigma_PAMI = getSigma(X_features1, X_features2);
	OverlapResult overlapRes_PAMI = FindOverlapFullSearch(sigma_PAMI);

	return overlapRes_PAMI;
}


